import React from "react";
import { Container } from "react-bootstrap";
import DoctorMenu from "../components/layout/DoctorMenu";

const RecentEvaluation = () => {
  return (
    <DoctorMenu>
      <Container
        style={{
          height: "100vh",
          padding: "5px 50px",

          overflowY: "auto",
          scrollbarWidth: "thin",
          scrollbarColor: "dark",
        }}
        className="recent-eval"
      ></Container>
    </DoctorMenu>
  );
};

export default RecentEvaluation;
